import React from "react";
import { Link } from "react-router-dom";
import { BACKEND_URL } from "../constants";
import './CrawlerCard.css'


export default function CrawlerCard({ crawler }) {
    return (
        <>
            <li className="cards__item_crawler">
                <Link className="cards__item__link_crawler"  to={{
                    pathname: "/seed-details",
                    state:{
                        seed:crawler
                    }
                }}>
                    <figure className="cards__item__pic-wrap_crawler" data-category={crawler.title}>
                        <img
                            className="cards__item__img_crawler"
                            alt="Travel"
                            src={BACKEND_URL + crawler.imageURL}
                        />
                    </figure>
                    <div className="cards__item__info_crawler">
                        <h5 className="cards__item__text_crawler">{crawler.description}</h5>
                    </div>
                </Link>
            </li>
        </>
    );
}
